import React, { Component } from 'react';
import './todoform.css';


 class Todoform extends Component {
     constructor(props){
         super(props)
         this.state = {
             todo:"nhgmjhmjhmkjk",
         }
     }
    render() {
        return (
            <div>
                <input type="search"></input>
                <button type="button"></button>
                <h1>this is me {this}</h1>


            </div>
        )
    }
}

export default Todoform
